import React from 'react';
import ContainerConsoleOpenActivList from './ContainerConsoleOpenActivList';
import ContainerCountRowForPage from './ContainerCountRowForPagee';


function FooterTable(props) {

    return (

        <div className={props.classname}>

            <ContainerConsoleOpenActivList
                stateTable={props.stateTable}
                CountRow={props.CountRow}
                func={props.func}
            />
               
            <ContainerCountRowForPage
                classname={props.classnameButtonConsoleCountRow}
            />

        </div>
    )
}

export default FooterTable
